import React, { Component } from "react"; 
import ReactDOM from "react-dom";
//import components 
import Checkout from './stripe-checkout';

//import logo
import logo from '../../assets/donate-differently-logo.png';

//import icons / material ui
import { Tooltip } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import MoreHorizIcon from '@material-ui/icons/MoreHoriz';  
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

//import bootstrap
import Row from 'react-bootstrap/Row';


export default class Payment extends Component {
    render() {
        return(
            <div className='payment'>

                <div className= 'row-1'>
                    <div className= 'col-1' id='arrrow'><ArrowBackIcon/></div>
                    <div className= 'col-1'><h1>Payment </h1></div>
                </div> 
               
                
                    <div className='border-wrap' >
                        <div className='payment-card'>
                            <div className='row-2'>
                                <div className='col-2' id='logo'><img src={logo}  className='logo' alt="logo"/></div>
                                <div className= 'col-2' id='more-icon'><MoreHorizIcon/></div>
                            </div>
                            <div className= 'row'>
                                <Checkout/>
                            </div>
                        </div>
                    </div>
                
               
            </div>
        );
    }
}
